import React from "react";

import styles from "./costumizacao.module.css"

import { FaCaretLeft, FaCaretRight } from "react-icons/fa6";

import planoDeFundo1 from "../../Assets/Personagem/PlanoDeFundo/Tela Batalha Chuvosa.jpg"
import planoDeFundo2 from "../../Assets/Personagem/PlanoDeFundo/Tela Batalha Nublada.jpg"
import planoDeFundo3 from "../../Assets/Personagem/PlanoDeFundo/Tela Batalha Neve.jpg"
import planoDeFundo4 from "../../Assets/Personagem/PlanoDeFundo/Tela Batalha.jpg"


import Menu from "../../Components/Menu.js"



export default function Costumizacao() {


    var opcoes = {
        /*
        cabelo: [prefixoImagens + '/Cabelo/cabeloLoiro.png', prefixoImagens + '/Cabelo/cabeloPreto.png', prefixoImagens + '/Cabelo/cabeloCastanho.png'],
        pele: [prefixoImagens + '/Pele/peleClara.png', prefixoImagens + '/Pele/peleMedia.png', prefixoImagens + '/Pele/peleEscura.png'],
        olho: [prefixoImagens + 'Olho/olho.png'],
        */
        planoDeFundo: [planoDeFundo1, planoDeFundo2, planoDeFundo3, planoDeFundo4]
    };

    var currentOptionIndexes = {
        /*
        cabelo: 0,
        pele: 0,
        olho: 0,
        */
        planoDeFundo: 0
    };

    function changeCharacter(parte, direcao) {
        var currentIndex = currentOptionIndexes[parte];
        var options = opcoes[parte];

        if (direcao === 'next') {
            currentOptionIndexes[parte] = (currentIndex + 1) % options.length;
        } else if (direcao === 'prev') {
            currentOptionIndexes[parte] = (currentIndex - 1 + options.length) % options.length;
        }

        var parteImage = document.getElementById(parte + '-image');
        parteImage.src = options[currentOptionIndexes[parte]];
    }

    function salvaPersonagem() {
        for (var part in currentOptionIndexes) {
            if (currentOptionIndexes.hasOwnProperty(part)) {
                localStorage.setItem(part, currentOptionIndexes[part]);
            }
        }
        console.log('Character saved!');
    }

    return(
        <div className={styles.costumizacaoContainer}>
            <Menu/>
            <div className={styles.costumizacaoWrap}>
                <div className={styles.leftContainer}>
                    <img src="../../Assets/Personagem/PlanoDeFundo/Tela Batalha.jpg" alt="planoDeFundo" id="planoDeFundo-image" className={styles.planoDeFundo}/>
                </div>
                <div className={styles.rigthContainer}>
                    <div className={styles.categoria}>
                        <FaCaretLeft size={35} color="#7A6C9D"/>
                        <h1>Estilo de cabelo</h1>
                        <FaCaretRight size={35} color="#7A6C9D"/>
                    </div>
                    <div className={styles.categoria}>
                        <FaCaretLeft size={35} color="#7A6C9D"/>
                        <h1>Cor de pele</h1>
                        <FaCaretRight size={35} color="#7A6C9D"/>
                    </div>
                    <div className={styles.categoria}>
                        <FaCaretLeft size={35} color="#7A6C9D"/>
                        <h1>Roupa</h1>
                        <FaCaretRight size={35} color="#7A6C9D"/>
                    </div>
                    <div className={styles.categoria}>
                        <FaCaretLeft size={35} color="#7A6C9D"/>
                        <h1>Cor do olho</h1>
                        <FaCaretRight size={35} color="#7A6C9D"/>
                    </div>
                    <div className={styles.categoria}>
                        <FaCaretLeft size={35} color="#7A6C9D" onClick={changeCharacter('planoDeFundo', 'next')}/>
                        <h1>Plano de fundo</h1>
                        <FaCaretRight size={35} color="#7A6C9D" onClick={changeCharacter('planoDeFundo', 'prev')}/>
                    </div>

                    <button className={styles.botaoSalvar}> SALVAR </button>
                </div>
            </div>
        </div>
    );
}
